import {
  Card,
  List,
  ListItem,
  Typography,
  Box,
  Chip,
  Collapse,
  IconButton,
} from '@mui/material';
import { TransitionGroup } from 'react-transition-group';
import SentimentSatisfiedAltIcon from '@mui/icons-material/SentimentSatisfiedAlt';
import SentimentNeutralIcon from '@mui/icons-material/SentimentNeutral';
import SentimentVeryDissatisfiedIcon from '@mui/icons-material/SentimentVeryDissatisfied';
import AccessTimeIcon from '@mui/icons-material/AccessTime';

const sentimentConfig = {
  positive: {
    icon: <SentimentSatisfiedAltIcon />,
    color: 'success',
    label: '正面',
    gradient: 'linear-gradient(45deg, #4caf50, #81c784)',
  },
  neutral: {
    icon: <SentimentNeutralIcon />,
    color: 'info',
    label: '中性',
    gradient: 'linear-gradient(45deg, #2196f3, #64b5f6)',
  },
  negative: {
    icon: <SentimentVeryDissatisfiedIcon />,
    color: 'error',
    label: '负面',
    gradient: 'linear-gradient(45deg, #f44336, #e57373)',
  },
};

const HistoryList = ({ history }) => {
  if (history.length === 0) {
    return (
      <Card
        sx={{
          p: 3,
          height: '100%',
          minHeight: 400,
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          backgroundColor: theme =>
            theme.palette.mode === 'light'
              ? 'rgba(255,255,255,0.9)'
              : 'rgba(18,18,18,0.8)',
          backdropFilter: 'blur(10px)',
          position: 'relative',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            height: '4px',
            background: theme =>
              theme.palette.mode === 'light'
                ? 'linear-gradient(90deg, #e3f2fd, #bbdefb, #90caf9)'
                : 'linear-gradient(90deg, #424242, #616161, #424242)',
          },
        }}
      >
        <Typography
          color="text.secondary"
          sx={{
            display: 'flex',
            alignItems: 'center',
            gap: 1,
            opacity: 0.7,
          }}
        >
          <AccessTimeIcon fontSize="small" />
          暂无分析记录
        </Typography>
      </Card>
    );
  }

  return (
    <Card
      sx={{
        backgroundColor: theme =>
          theme.palette.mode === 'light'
            ? 'rgba(255,255,255,0.9)'
            : 'rgba(18,18,18,0.8)',
        backdropFilter: 'blur(10px)',
        position: 'relative',
        overflow: 'hidden',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          height: '4px',
          background: theme =>
            theme.palette.mode === 'light'
              ? 'linear-gradient(90deg, #e3f2fd, #bbdefb, #90caf9)'
              : 'linear-gradient(90deg, #424242, #616161, #424242)',
        },
      }}
    >
      <List sx={{ p: 0 }}>
        <TransitionGroup>
          {history.map((item, index) => (
            <Collapse key={item.timestamp}>
              <ListItem
                sx={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'flex-start',
                  borderBottom: '1px solid',
                  borderColor: 'divider',
                  p: 2,
                  '&:last-child': {
                    borderBottom: 'none',
                  },
                  '&:hover': {
                    backgroundColor: theme =>
                      theme.palette.mode === 'light'
                        ? 'rgba(0,0,0,0.02)'
                        : 'rgba(255,255,255,0.02)',
                  },
                  transition: 'background-color 0.3s ease',
                }}
              >
                <Typography
                  variant="body1"
                  sx={{
                    mb: 1,
                    position: 'relative',
                    '&::before': {
                      content: '""',
                      position: 'absolute',
                      left: -8,
                      top: '50%',
                      transform: 'translateY(-50%)',
                      width: 3,
                      height: '70%',
                      background: sentimentConfig[item.sentiment].gradient,
                      borderRadius: '4px',
                    },
                    pl: 1,
                  }}
                >
                  {item.text}
                </Typography>
                <Box
                  sx={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    width: '100%',
                    alignItems: 'center',
                  }}
                >
                  <Chip
                    icon={sentimentConfig[item.sentiment].icon}
                    label={sentimentConfig[item.sentiment].label}
                    sx={{
                      background: sentimentConfig[item.sentiment].gradient,
                      color: '#fff',
                      '& .MuiChip-icon': {
                        color: '#fff',
                      },
                    }}
                    size="small"
                  />
                  <Typography
                    variant="caption"
                    color="text.secondary"
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: 0.5,
                    }}
                  >
                    <AccessTimeIcon fontSize="inherit" />
                    {new Date(item.timestamp).toLocaleString()}
                  </Typography>
                </Box>
              </ListItem>
            </Collapse>
          ))}
        </TransitionGroup>
      </List>
    </Card>
  );
};

export default HistoryList;
